import React from 'react';

const CourseList = ({ courses, searchTerm, handleSearchChange, totalQPI }) => {
  return (
    <div>
      <h2 id='title'>Course List</h2>
      <input type="text" placeholder="Search" value={searchTerm} onChange={handleSearchChange} />
      <table id='courselist'>
        <thead>
          <tr>
            <th>Course Name</th>
            <th>Course Number</th>
            <th>Units</th>
            <th>Grade</th>
          </tr>
        </thead>
        <tbody>
          {courses.map((course, index) => (
            <tr key={index}>
              <td>{course.courseName}</td>
              <td>{course.courseNumber}</td>
              <td>{course.units}</td>
              <td>{course.grade}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <div className="qpi">
        <p>Total QPI: {totalQPI.toFixed(2)}</p>
      </div>
    </div>
  );
};

export default CourseList;
